import Swapy from 'swapy';

function TodoItem({text,completed,swapy}) {
    return (
    <li className={`li_todos ${completed ? "completed" : ""}`} data-swapy-item={swapy}>
      <span className={`span_accion completedItem`}>V</span>
      <p>{text}</p>
      <span className="span_accion deleteItem">X</span>
    </li>
  );
  }
export {TodoItem};
